import { NavLink } from "react-router-dom";
import "./Home.css";

export function Home(): JSX.Element {
    return (
        <div className="Home">
            <div className="marquee">
                <h1>See the World</h1>
            </div>
            <button className="navLinkBtn" id="allButton">
                <NavLink to="/about">Click To See The World</NavLink>
            </button>
            <div id="countryCards"></div>



        </div>
    );
}
